import "./App.css";
import { NewPage } from "./component/NewPage";
import { Routes, Route, Link } from "react-router-dom";
import Datashow from "./component/Datashow";

function App() {
  return (
    <div className="container">
      <Link to={"/"}>Home</Link>
      <Routes>
        <Route path="/" element={<Datashow/>} />
        <Route path="/pages/:id" element={<NewPage />} />
      </Routes>
    </div>
  );
}

export default App;
